import React from 'react';
import bck from "../../img/Gradient.png";

export default function Description() {
  return (
    <div style={{backgroundImage: `url(${bck})`, backgroundRepeat: "no-repeat", backgroundSize: "cover"}}>
        <div className="description container flex">
            <ul className="description-list list-reset">
                <li className="description-item">прогрессивное</li>
                <li className="description-item">digital-агентство,</li>
                <li className="description-item">специализирующееся</li>
                <li className="description-item">на создании</li>
                <li className="description-item">облачной архитектуры</li>
                <li className="description-item">для фармбизнеса</li>
            </ul>
        </div> 
    </div>

  )
}
